        return (
            <div id="about">
                <Cards />
                <p>
                    <br></br>
                </p>
                <Container>
                    <Row>
                        <Col>
                        <hr></hr>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default About;
